import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';

import {teal_palette} from '../mui/metMuiThemes';

import Grid from "@material-ui/core/Grid/Grid";
import Adress from "./Adress";
import LevelBar from "./LevelBar";
import Status from "./Status";

const styles = theme => ({
    footer: {
	backgroundColor:teal_palette.main,
	color:'white',
	height: '30px',
    },
    text: {
	maxWidth: "100%",
	margin: "1%",
	width:'90%',
    },
    icon: {
	height:'100%',
	width:'100%',
	fill:'Red',
    }
});

//text        maxWidth: theme.spacing.getMaxWidth.maxWidth,
//text        margin: theme.spacing.getMaxWidth.margin,



function Footer(props) {
    const { classes, state } = props;
    return (
	    <div className={classes.footer}>
            <Grid container spacing={10} className={classes.text}>
	       <Grid item xs={2}>
 	          <Adress />
	       </Grid>
	       <Grid item xs={6}>
	          <LevelBar state={state}/>
	       </Grid>
	       <Grid item xs={4} style={{position: 'absolute', right: 5}}>
	          <Status state={state}/>
	       </Grid>
	    </Grid>
        </div>
    );
}

